DROP TABLE IF EXISTS `mxk_roles`;
CREATE TABLE IF NOT EXISTS `mxk_roles` (
  `ID` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'ID',
  `ROLECODE` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `ROLENAME` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT 'GROUP NAME',
  `category` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '动态用户组，dynamic动态组 static静态组app应用账号组',
  `FILTERS` text CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '过滤条件SQL',
  `ORGIDSLIST` text CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '机构列表',
  `RESUMETIME` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT 'RESUMETIME',
  `SUSPENDTIME` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT 'SUSPENDTIME',
  `STATUS` tinyint unsigned DEFAULT NULL COMMENT 'STATUS',
  `CREATEDBY` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT 'CREATEDBY',
  `ISDEFAULT` tinyint unsigned DEFAULT NULL COMMENT 'ISDEFAULT',
  `CREATEDDATE` datetime DEFAULT NULL COMMENT 'CREATEDDATE',
  `MODIFIEDBY` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT 'MODIFIEDBY',
  `MODIFIEDDATE` datetime DEFAULT NULL COMMENT 'MODIFIEDDATE',
  `DESCRIPTION` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT 'DESCRIPTION',
  `INSTID` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  PRIMARY KEY (`ID`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='groups';

INSERT INTO `mxk_roles` (`ID`, `ROLECODE`, `ROLENAME`, `category`, `FILTERS`, `ORGIDSLIST`, `RESUMETIME`, `SUSPENDTIME`, `STATUS`, `CREATEDBY`, `ISDEFAULT`, `CREATEDDATE`, `MODIFIEDBY`, `MODIFIEDDATE`, `DESCRIPTION`, `INSTID`) VALUES
