DROP TABLE IF EXISTS `mxk_userinfo`;
CREATE TABLE IF NOT EXISTS `mxk_userinfo` (
  `ID` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '编号',
  `USERNAME` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '登录名',
  `PASSWORD` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '密码',
  `DECIPHERABLE` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'DE密码',
  `COMPONENT` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '组件的随机字符串',
  `AUTHNTYPE` tinyint unsigned DEFAULT '1' COMMENT '认证类型',
  `MOBILE` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '手机号码',
  `MOBILEVERIFIED` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '手机号验证',
  `EMAIL` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '邮箱',
  `EMAILVERIFIED` smallint unsigned DEFAULT NULL COMMENT '邮箱验证',
  `DISPLAYNAME` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '显示名称',
  `NICKNAME` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '昵称',
  `PICTURE` longblob COMMENT '头像',
  `TIMEZONE` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT 'Asia/Shanghai' COMMENT '时区',
  `LOCALE` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT 'zh_CN' COMMENT '地址',
  `PREFERREDLANGUAGE` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT 'zh_CN' COMMENT '语言偏好',
  `PASSWORDQUESTION` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '密码问题',
  `PASSWORDANSWER` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '密码答案',
  `APPLOGINAUTHNTYPE` tinyint unsigned DEFAULT '0' COMMENT '应用登录认证类型',
  `APPLOGINPASSWORD` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '应用登录密码',
  `PROTECTEDAPPS` varchar(450) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '应用登录密码保护应用',
  `THEME` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT 'default' COMMENT '主题',
  `GRIDLIST` tinyint unsigned DEFAULT '0' COMMENT '应用列表类型',
  `LOGINCOUNT` int unsigned DEFAULT '0' COMMENT '登录次数统计',
  `ONLINE` tinyint unsigned DEFAULT '0' COMMENT '在线状态',
  `STATUS` tinyint unsigned DEFAULT '1' COMMENT '用户状态',
  `ISLOCKED` tinyint unsigned DEFAULT '1' COMMENT '锁定状态',
  `UNLOCKTIME` datetime DEFAULT '2020-01-01 01:01:01' COMMENT '解锁时间',
  `LASTLOGINIP` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '最近登录IP地址',
  `LASTLOGINTIME` datetime DEFAULT '2020-01-01 01:01:01' COMMENT '最近登录时间',
  `LASTLOGOFFTIME` datetime DEFAULT '2020-01-01 01:01:01' COMMENT '最近注销时间',
  `BADPASSWORDTIME` datetime DEFAULT '2020-01-01 01:01:01' COMMENT '最近密码错误时间',
  `BADPASSWORDCOUNT` smallint unsigned DEFAULT NULL COMMENT '密码错误次数',
  `PASSWORDLASTSETTIME` datetime DEFAULT '2020-01-01 01:01:01' COMMENT '最近密码修改时间',
  `PASSWORDSETTYPE` tinyint unsigned DEFAULT '0' COMMENT '密码重置类型',
  `SHAREDSECRET` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT 'TIME-OPT密钥',
  `SHAREDCOUNTER` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT 'COUNTER-OPT密钥',
  `USERTYPE` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT 'Customer' COMMENT '用户类型',
  `USERSTATE` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT 'RESIDENT',
  `EMPLOYEENUMBER` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '工号',
  `WINDOWSACCOUNT` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT 'AD域账号',
  `DIVISION` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '分支',
